食品を保存するのに便利なフードコンテナと<br>
おしぼりのギフトセットです♪<br><br>
★保存容器やお弁当箱としてもお使い頂けます。<br>　（密封機能はございませんので、汁ものには<br>
　　お使いいただけませんのでご注意ください。）
<br><br>
ポリプロピレン製ですので冷凍にも電子レンジでの
<br>温めにもお使いいただけます。<br><br>
【内容明細】<br><br>
・電子レンジ容器（大）<br>
　　幅18cm×たて12cm×高さ5.5cm<br>
・電子レンジ容器（小）<br>
　　幅13.5cm×たて8.5cm×高さ5.5cm<br><br>
〔材質　(大)・(小)〕<br>
　　フタ、本体／ポリプロピレン<br>
　　バルブ／シリコン樹脂<br><br>
〔容量〕大：500ml／小：240ml<br><br>
＊生産国：日本
<br><br>
・タオルおしぼり<br>
　　綿100%／幅28cm×たて30cm<br><br>
＊生産国：日本<br>
<br>
<font color="#0000cd">
※誠に申し訳ございませんが当店では、<br>
　ラッピング等はお受けしておりませんので<br>
　ご了承ください。</font><br><br>
<BR><BR><img src="http://image.rakuten.co.jp/casmin/cabinet/05049938/05111922/05126499/imgrc0071053939.jpg" width="320"><br><BR>

